// ICI Create a Class for web services ? Refactor
function getCryptoByMarketcap() {
  axios({
    method: "get",
    url:
      "https://pro-api.coinmarketcap.com/v1/cryptocurrency/listings/latest?start=1&limit=1&convert=USD",
    headers: { "X-CMC_PRO_API_KEY": "80415b01-6c5a-4547-b5d0-f80814428492" }
  })
    .then(response => {
      console.log(response);
    })
    .catch(error => {
      console.log(error);
    });
}

export default getCryptoByMarketcap;
